// ResultPage.jsx
import React from "react";
import { useLocation, useNavigate } from "react-router-dom";
import "./index.css";

const translations = {
  ko: {
    noResult: "‚ùó ÏÑ§Î¨∏ Í≤∞Í≥ºÍ∞Ä ÏóÜÏäµÎãàÎã§",
    prompt: "ÌôàÌéòÏù¥ÏßÄÏóêÏÑú ÏÑ§Î¨∏ÏùÑ Î®ºÏ†Ä Ï†úÏ∂úÌï¥ Ï£ºÏÑ∏Ïöî.",
    backHome: "ÌôàÏúºÎ°ú ÎèåÏïÑÍ∞ÄÍ∏∞",
    title: "üìäMBI HSS ÏÑ§Î¨∏ Í≤∞Í≥º",
    exhaustion: "ÏÜåÏßÑ Ï†êÏàò ÌèâÍ∑†",
    depersonal: "ÎπÑÏù∏Í≤©Ìôî Ï†êÏàò ÌèâÍ∑†",
    efficacy: "Ìö®Îä•Í∞ê Ï†êÏàò",
    retry: "Îã§Ïãú ÌïòÍ∏∞"
  },
  en: {
    noResult: "‚ùó No survey result found",
    prompt: "Please submit the survey on the homepage first.",
    backHome: "Return to Home",
    title: "üìäMBI HSS Survey Result",
    exhaustion: "Exhaustion Mean Score",
    depersonal: "Depersonalization Mean Score",
    efficacy: "Efficacy Score",
    retry: "Try Again"
  },
  my: {
    noResult: "‚ùó ·ÄÖ·ÄÖ·Ä∫·Äê·Äô·Ä∫·Ä∏·Äõ·Äú·Äí·Ä∫·Äô·Äõ·Äæ·Ä≠·Äï·Ä´",
    prompt: "·Äï·ÄÑ·Ä∫·Äô·ÄÖ·Ä¨·Äô·Äª·ÄÄ·Ä∫·Äî·Äæ·Ä¨·Äê·ÄΩ·ÄÑ·Ä∫ ·ÄÖ·ÄÖ·Ä∫·Äê·Äô·Ä∫·Ä∏·Äñ·Äº·Ää·Ä∑·Ä∫·Äï·Ä±·Ä∏·Äï·Ä´·Åã",
    backHome: "·Äô·Ä∞·Äú·Äû·Ä≠·ÄØ·Ä∑·Äï·Äº·Äî·Ä∫·Äô·Ää·Ä∫",
    title: "üìäMBI HSS ·ÄÖ·ÄÖ·Ä∫·Äê·Äô·Ä∫·Ä∏·Äõ·Äú·Äí·Ä∫",
    exhaustion: "·Äï·ÄÑ·Ä∫·Äï·Äî·Ä∫·Ä∏·Äî·ÄΩ·Äô·Ä∫·Ä∏·Äî·Äö·Ä∫·Äô·Äæ·ÄØ ·Ä°·Ä¨·Ä∏·Äñ·Äº·Ää·Ä∑·Ä∫·Äô·Äæ·Äê·Ä∫",
    depersonal: "·Äô·Äê·Ää·Ä∫·ÄÄ·Äº·Ää·Ä∫·Äô·Äæ·ÄØ ·Ä°·Ä¨·Ä∏·Äñ·Äº·Ää·Ä∑·Ä∫·Äô·Äæ·Äê·Ä∫",
    efficacy: "·Äë·Ä≠·Äõ·Ä±·Ä¨·ÄÄ·Ä∫·Äô·Äæ·ÄØ ·Ä°·Ä¨·Ä∏·Äñ·Äº·Ää·Ä∑·Ä∫·Äô·Äæ·Äê·Ä∫",
    retry: "·Äë·Äï·Ä∫·Äô·Ä∂·Äú·ÄØ·Äï·Ä∫·ÄÜ·Ä±·Ä¨·ÄÑ·Ä∫·Äô·Ää·Ä∫"
  }
};

export default function ResultPage() {
  const { state } = useLocation();
  const navigate = useNavigate();

  const lang = state?.lang || "ko";
  const t = translations[lang];

  if (!state) {
    return (
      <div className="burnout-container">
        <h2>{t.noResult}</h2>
        <p>{t.prompt}</p>
        <div className="burnout-button-center">
          <button className="burnout-button" onClick={() => navigate("/")}>{t.backHome}</button>
        </div>
      </div>
    );
  }

  const { exhaustionMean, depersonalMean, efficacyMean, exhaustionT, depersonalT, efficacyT } = state;

  return (
    <div className="burnout-container">
      <main className="burnout-main">
        <section className="burnout-section">
          <h2 className="burnout-title">{t.title}</h2>
          <div className="burnout-result-box">
            <p className="burnout-result-text">{t.exhaustion}: {exhaustionMean.toFixed(2)} / T= {exhaustionT.toFixed(1)}</p>
            <p className="burnout-result-text">{t.depersonal}: {depersonalMean.toFixed(2)} / T= {depersonalT.toFixed(1)}</p>
            <p className="burnout-result-text">{t.efficacy}: {efficacyMean.toFixed(2)} / T= {efficacyT.toFixed(1)}</p>
          </div>
          <div className="burnout-button-center">
            <button className="burnout-button" onClick={() => navigate("/")}>{t.retry}</button>
          </div>
        </section>
      </main>
    </div>
  );
}
